// data.js — chứa ngân hàng câu hỏi (Base64 UTF-8) + hàm giải mã
// Đặt file này cùng thư mục với index.html

(function () {
  function b64ToText(b64) {
    const bin = atob(b64);
    const bytes = new Uint8Array(bin.length);
    for (let i = 0; i < bin.length; i++) bytes[i] = bin.charCodeAt(i);
    return new TextDecoder('utf-8').decode(bytes);
  }
  const BANKS = [
    { subject: "Phát triển ứng dụng Web (Mở nguồn)", b64: "" },
    { subject: "Quản trị dự án CNTT", b64: "" }
  ];
  window.quizData = {
    getAll() { return BANKS.map(x => ({ subject: x.subject, text: b64ToText(x.b64) })); }
  };
})();
